import React from 'react'
import {useHistory} from 'react-router-dom'


const ApplicationPost = (prop) => {
    const router = useHistory()
  return (
    <div className='post'>
        <div className='post__content'>
            <strong>{prop.post.IDApplication}</strong>
            <p>{prop.post.Name}</p>
            <strong>{prop.post.StatusHistory[prop.post.StatusHistory.length - 1]}</strong>
            <button onClick={() => router.push('/application/${props.post.IDApplication}')}>Открыть</button>
        </div>
    </div>
  )
}

export default ApplicationPost
